column1990:
16/Jun/25 6:53 AM;mehul.thakral;*Update Based on the pluto logs -*
Backup job kept running with RunJob grpc calls of type kFlushCdpLogs for more than 2 hours. Then on triggering CancelJob call with kBackup, it failed with WARN of info.proto file not found because it was not created in the first place as RunJob with KBackup call was not made, since the job was stuck on kFlushCdpLogs itself.
 
Then on getting getCompletedJobDetails call with KBackup it threw FileNotFound exception for info.proto and RuntimeException in ImanisGrpcService.
 
Reason for job being stuck at kFlushCdpLogs seems to be Atom connection failure for the entire duration -
 
{code:java}
2025-06-13 06:51:36 [s-1211-j-172-atw-1] ERROR RetryHandler:123 - Operation failed. Cannot retry. io.grpc.StatusRuntimeException: UNAVAILABLE: io exception at io.grpc.stub.ClientCalls.toStatusRuntimeException(ClientCalls.java:235) at io.grpc.stub.ClientCalls.getUnchecked(ClientCalls.java:216) at io.grpc.stub.ClientCalls.blockingUnaryCall(ClientCalls.java:141) at cohesity.atom.stub.RpcServiceGrpc$RpcServiceBlockingStub.writeData(RpcServiceGrpc.java:281) at com.talena.agent.mongodb.cdp.atom.BlockingAtomEndpoint.writeData(BlockingAtomEndpoint.java:110) at com.talena.agent.mongodb.cdp.atom.AtomConnector.lambda$writeData$9(AtomConnector.java:365) at com.talena.agent.commons.RetryHandler.callWithRetry(RetryHandler.java:108) at com.talena.agent.mongodb.cdp.atom.AtomConnector.writeData(AtomConnector.java:363) at com.talena.agent.mongodb.cdp.atom.AtomWriter.lambda$writeAsync$0(AtomWriter.java:131) at java.util.concurrent.ThreadPoolExecutor.runWorker(ThreadPoolExecutor.java:1149) at java.util.concurrent.ThreadPoolExecutor$Worker.run(ThreadPoolExecutor.java:624) at java.lang.Thread.run(Thread.java:750) Caused by: io.grpc.netty.shaded.io.netty.channel.AbstractChannel$AnnotatedConnectException: finishConnect(..) failed: Connection refused: /10.102.1.136:20004 Caused by: java.net.ConnectException: finishConnect(..) failed: Connection refused at io.grpc.netty.shaded.io.netty.channel.unix.Errors.throwConnectException(Errors.java:124) at io.grpc.netty.shaded.io.netty.channel.unix.Socket.finishConnect(Socket.java:243) at io.grpc.netty.shaded.io.netty.channel.epoll.AbstractEpollChannel$AbstractEpollUnsafe.doFinishConnect(AbstractEpollChannel.java:667) at io.grpc.netty.shaded.io.netty.channel.epoll.AbstractEpollChannel$AbstractEpollUnsafe.finishConnect(AbstractEpollChannel.java:644) at io.grpc.netty.shaded.io.netty.channel.epoll.AbstractEpollChannel$AbstractEpollUnsafe.epollOutReady(AbstractEpollChannel.java:524) at io.grpc.netty.shaded.io.netty.channel.epoll.EpollEventLoop.processReady(EpollEventLoop.java:414) at io.grpc.netty.shaded.io.netty.channel.epoll.EpollEventLoop.run(EpollEventLoop.java:326) at io.grpc.netty.shaded.io.netty.util.concurrent.SingleThreadEventExecutor$5.run(SingleThreadEventExecutor.java:918) at io.grpc.netty.shaded.io.netty.util.internal.ThreadExecutorMap$2.run(ThreadExecutorMap.java:74) at io.grpc.netty.shaded.io.netty.util.concurrent.FastThreadLocalRunnable.run(FastThreadLocalRunnable.java:30) at java.lang.Thread.run(Thread.java:750){code}
[~Joydip.Datta] Should we assign to Atom team for further investigation?;;;

column1991:
16/Jun/25 8:38 AM;Joydip.Datta;If Atom is unresponsive, backup waits 30 minutes for the CDP logs to catch up before timing out. Timing out this way is NOT a blocker as this is how we "degrade" under heavy load. 

In any case, we should not see `FileNotFound` and this is an app issue and will be handled in IMAN-7.2.2

[~mehul.thakral] Please check atom logs and if there is any crash, file a NEW BUG and assign it to the SiteContinuity squad. ;;;

column1992:
16/Jun/25 10:57 PM;Joydip.Datta;[~mathew.joseph] I do not see the Imanis explorer -OR the Cohesity time-capsule- attached to this bug. Also, the noted cluster is not accessible.

We would need to reproduce this and attach the relevant logs.

CC [~mehul.thakral],;;;

